import React from 'react';

class Item extends React.Component {
    constructor(props) {
        super(props)
    }

    render() {
        console.log(this.props.item)
        return (
            <div class="container">
                <div class="col-6">{this.props.item.name}</div>
                <div class="col-6">{this.props.item.category}</div>
            </div>
        );
    }
}
  
export default Item;
